import React, { Component } from 'react'

class Customers extends Component {
    render() {
        return(
            <div className="container">
                <div className="col-md-6">
                    <ul>
                        {
                            this.props.users.map((user, i) =>
                            <li key={user.id}>
                                <p>{user.first}</p>
                            </li>)
                        }
                    </ul>
                </div>
            </div>
        )
    }
}

export default Customers;
